Capacitacion_contenido:
 1. SUJEITO, CONTEXTO E SUBSTÂNCIAS PSICOATIVAS: A COMPLEXIDADE DO FENÔMENO DO USO ÁLCOOL E OUTRAS DROGAS;
2. PADRÕES DE USO: TIPOS DE USO, ABUSO E DEPENDÊNCIA;
3.A POLÍTICA NACIONAL SOBRE DROGAS (PNAD) E A POLÍTICA NACIONAL SOBRE O ÁLCOOL
4. POLÍTICAS SETORIAIS DE SAÚDE E DE ASSISTÊNCIA SOCIAL;
5. REDE DE ATENÇÃO: SUS (PSF, NASF, CAPS, HG), SUAS (CRAS, CREAS) E SUAS INTER-RELAÇÕES;
6. A SAÚDE MENTAL NAS POLÍTICAS PÚBLICAS DE SAÚDE;
7. NÍVEIS DE INTERVENÇÃO: PROMOÇÃO DA SAÚDE, PREVENÇÃO, CUIDADO E REABILITAÇÃO;
8. CONCEITO DE DROGAS E SEUS PADRÕES DE USO (INTOXICAÇÃO AGUDA, USO CRÔNICO, USO NOCIVO, DEPENDÊNCIA, ABSTINÊNCIA);
9. AS DROGAS E SEUS EFEITOS NA SOCIEDADE: ABORDAGEM SÓCIO-ANTROPOLÓGICA;
10. EPIDEMIOLOGIA DO USO DE DROGAS NO BRASIL E NO MUNDO;
11. OS PRINCIPAIS QUADROS CLÍNICO-PSICOPATOLÓGICOS DECORRENTES DO USO DAS DIVERSAS DROGAS;
12. ABORDAGENS TERAPÊUTICAS DO USUÁRIO DE DROGAS: ATENÇÃO INTEGRAL;
13. CONCEITOS FUNDAMENTAIS: ACOLHIMENTO, ESCUTA, VÍNCULO, EMPATIA;
14. PROJETO TERAPÊUTICO SINGULAR (PTS);
15. ABORDAGENS TERAPÊUTICAS DO USUÁRIO DE DROGAS: DESINTOXICAÇÃO;
16. ABORDAGENS TERAPÊUTICAS DO USUÁRIO DE DROGAS: TERAPIAS FARMACOLÓGICAS;
17. ABORDAGENS TERAPÊUTICAS DO USUÁRIO DE DROGAS: INTERVENÇÃO BREVE, ACONSELHAMENTO MOTIVACIONAL E REDUÇÃO DE DANOS;
18. ABORDAGENS TERAPÊUTICAS DO USUÁRIO DE DROGAS: REABILITAÇÃO PSICOSSOCIAL;
19. CRITÉRIOS CLÍNICOS PARA A INTERNAÇÃO E A PARA A ALTA DE USUÁRIOS DE DROGAS;
20. ABORDAGEM DOS FAMILIARES DO USUÁRIO DE CRACK E OUTRAS DROGAS;
21. VIOLÊNCIA DOMÉSTICA E ABUSO DE ÁLCOOL, CRACK E OUTRAS DROGAS;
22. REDES DE APOIO SOCIAL E REINSERÇÃO SOCIAL DO USUÁRIO DE DROGAS.
